import React from "react";
import Popup from "./Popup";
import { Button } from "./Button";
import { useState } from "react";
import { BrowserRouter, Route, Switch } from 'react-router-dom';


function Proposal() {
  const [buttonPopup, setButtonPopup] = useState(false);

  return (
    <div className="testProposal">
      <Button onClick={() => setButtonPopup(true)}>PROJECT PROPOSAL</Button>
      <Popup trigger={buttonPopup} setTrigger={setButtonPopup}>
        <h3>Link to Project Proposal</h3>
        <BrowserRouter>
          <Route path="/project-proposal" component={() => {
            window.location.href = 'https://drive.google.com/file/d/1K1J17BuAT-SnZa_nSlHPGDkXoyTBx3cW/view?usp=sharing';
            return null;
          }}/>
        </BrowserRouter>
      </Popup>
    </div>
  );
}

export default Proposal;
